import {ServiceComponent} from './ratedServiceComponent';
export const VoteComponent = ({services=[]})=>{
    return(
        <div>
            <ul>{services.map((vote)=>{
                return(
                    <div  key={vote.id}>
                        <ServiceComponent service={vote.service}/>
                        <li>{vote.votes}</li>
                    </div>
                )
            })}</ul>
        </div>
    );
}
